import React from 'react';

// Data
import { events } from "../../mockData";

// Components
import Card from "../../components/Card";

const CardsContainer = () => {

    const renderCards = () => {
        return events.map((event) => {
            return (
                <Card event={event}/>
            )
        })
    }

 return (
     <div className="card-container">
         <h1>
             Workouts
         </h1>
         {renderCards()}
     </div>
 )
}

export default CardsContainer;
